import "./App.css";
import ExpenseList from "./Components/ExpenseList";
import FilterForm from "./Components/FilterForm";

function App() {
  const expenses = [
    {
      name: "gio",
      price: 2660,
      type: "food",
      date: new Date(),
      memo: "hoooha",
    },
  ];
  return (
    <div className="App">
      <FilterForm />
      <ExpenseList />
    </div>
  );
}

export default App;
